import React, {useState,useEffect} from 'react';

const Sem=()=>{

  const [Sems,setSems]=useState([]);
  useEffect(()=>{
      const Response=async()=>{
          const {data}=await axios.get("http://127.0.0.1:8000/api/seminar/");
          setSems(data);
      };
      Response();
  },[])

  Sems.reverse();

  const display=Sems.map((x,index)=>{
    let ar=x.video.split("be/");
    let a=ar[1]
    // console.log(ar[1])

    return (
        <div  className="card" key={index}>
        <div className="c"> 

        <div className="frame1">
        <img src="https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg" height="160px" width="180px"></img>
</div>
        <h3 style={{color:'black',textAlign:'center',padding:'10px 10px'}}>{x.date}</h3>

        <div className="flexs">
        <div className='disp' style={{textAlign:'center'}}>
        <p >{x.description}</p>
        </div>
        </div>
        </div>
    </div>
    )
})
return (

    <div className='container'>
    <div className="card2">
    {display}</div>
    </div>
)
};

export default Sem;



















































